import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; 
import Login from './components/LoginPage';




function App() { 
  return (
    <Router> 
      <Navbar />
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
    </Router> 
  );
}

export default App;
